import Home from '../components/pages/home/index'
import Add from "../components/pages/add/index";

const router = createBrowserRouter([
    {
      path: "/",
      element: <Home />
    },
    {
      path: "/add",
      element: <Add />
    },
    {
      
    }
  ]);

export default router
